import React, { useState, useEffect } from 'react';
import styled from 'styled-components';
import { FiPlus, FiUser } from 'react-icons/fi';
import { theme } from '../../styles/theme';
import { Card, Button, Badge } from '../../styles/GlobalStyles';
import { Driver } from '../../types';
import { mockAPI } from '../../services/mockData';

const DriversContainer = styled.div`
  display: flex;
  flex-direction: column;
  gap: ${theme.spacing.xl};
`;

const PageHeader = styled.div`
  display: flex;
  justify-content: space-between;
  align-items: center;
`;

const PageTitle = styled.h1`
  font-size: ${theme.typography.fontSize['3xl']};
  font-weight: ${theme.typography.fontWeight.bold};
  color: ${theme.colors.textPrimary};
  margin: 0;
`;

const DriversGrid = styled.div`
  display: grid;
  grid-template-columns: repeat(auto-fill, minmax(300px, 1fr));
  gap: ${theme.spacing.lg};
`;

const DriverCard = styled(Card)`
  display: flex;
  flex-direction: column;
  gap: ${theme.spacing.md};
`;

const DriverHeader = styled.div`
  display: flex;
  align-items: center;
  gap: ${theme.spacing.md};
`;

const DriverAvatar = styled.div`
  width: 50px;
  height: 50px;
  background: ${theme.colors.primary};
  border-radius: 50%;
  display: flex;
  align-items: center;
  justify-content: center;
  color: white;
  font-weight: ${theme.typography.fontWeight.bold};
`;

const DriverInfo = styled.div`
  flex: 1;
`;

const DriverName = styled.h3`
  font-size: ${theme.typography.fontSize.lg};
  font-weight: ${theme.typography.fontWeight.semibold};
  color: ${theme.colors.textPrimary};
  margin: 0;
`;

const DriverEmail = styled.div`
  color: ${theme.colors.textSecondary};
  font-size: ${theme.typography.fontSize.sm};
`;

const DriverStats = styled.div`
  display: grid;
  grid-template-columns: 1fr 1fr;
  gap: ${theme.spacing.md};
  margin-top: ${theme.spacing.md};
`;

const StatItem = styled.div`
  text-align: center;
`;

const StatValue = styled.div`
  font-size: ${theme.typography.fontSize.lg};
  font-weight: ${theme.typography.fontWeight.bold};
  color: ${theme.colors.textPrimary};
`;

const StatLabel = styled.div`
  font-size: ${theme.typography.fontSize.xs};
  color: ${theme.colors.textMuted};
`;

const Drivers: React.FC = () => {
  const [drivers, setDrivers] = useState<Driver[]>([]);
  const [loading, setLoading] = useState(true);

  useEffect(() => {
    const loadDrivers = async () => {
      try {
        const driversData = await mockAPI.getDrivers();
        setDrivers(driversData);
      } catch (error) {
        console.error('Error loading drivers:', error);
      } finally {
        setLoading(false);
      }
    };

    loadDrivers();
  }, []);

  if (loading) {
    return <div>Loading drivers...</div>;
  }

  return (
    <DriversContainer className="fade-in">
      <PageHeader>
        <PageTitle>Drivers</PageTitle>
        <Button variant="primary">
          <FiPlus />
          Add Driver
        </Button>
      </PageHeader>

      <DriversGrid>
        {drivers.map((driver) => (
          <DriverCard key={driver.id}>
            <DriverHeader>
              <DriverAvatar>
                {driver.firstName[0]}{driver.lastName[0]}
              </DriverAvatar>
              <DriverInfo>
                <DriverName>{driver.firstName} {driver.lastName}</DriverName>
                <DriverEmail>{driver.email}</DriverEmail>
              </DriverInfo>
              <Badge variant={driver.status === 'active' ? 'success' : 'error'}>
                {driver.status}
              </Badge>
            </DriverHeader>

            <DriverStats>
              <StatItem>
                <StatValue>{driver.totalTrips}</StatValue>
                <StatLabel>Total Trips</StatLabel>
              </StatItem>
              <StatItem>
                <StatValue>{driver.rating}</StatValue>
                <StatLabel>Rating</StatLabel>
              </StatItem>
            </DriverStats>
          </DriverCard>
        ))}
      </DriversGrid>
    </DriversContainer>
  );
};

export default Drivers;
